import Login from "./pages/login/Login";
import Register from "./pages/register/Register";
import Profile from "./pages/profile/Profile";
import Home from "./pages/home/Home";
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path = "/">
          <Home />
        </Route>

        <Route path = "/">
          <Login />
        </Route>

        <Route path = "/">
          <Register />
        </Route>

        <Route path = "/">
          <Profile />
        </Route>
      </Routes>
    </Router>
  )
};

export default App;
